INSERT INTO `articles` VALUES (1,2,'Новая акция','novaya-akciya','Новая статьяНовая статьяНовая статья','<p>Новая статьяНовая статьяНовая статьяНовая статьяНовая статья</p>\r\n','a:2:{s:4:\"file\";s:54:\"/uploads/ba/86/b2/ba86b24b-65a6-4dc5-a9cd-d25cfb1c5803\";s:3:\"ext\";s:4:\".jpg\";}','2016-08-22 12:55:33','2016-12-16 14:33:50',16),(2,1,'Новая статья1','novaya-statya','Дорогие друзья, спешим вам сообщить приятную новость. С 8 ноября 2014 на территории ЖК «София от Мартынова» открыл свои двери новый фитнес клуб «София sport».  Фитнес-клуб «София sport» - это спортивный комплекс для всей семьи, площадью целых... ТЕСТ','<p>Дорогие друзья, спешим вам сообщить приятную новость. С 8 ноября 2014 на территории ЖК &laquo;София от Мартынова&raquo; открыл свои двери новый фитнес клуб &laquo;София sport&raquo;.&nbsp; Фитнес-клуб &laquo;София sport&raquo; - это спортивный комплекс для всей семьи, площадью целых...</p>\r\n\r\n<p>Дорогие друзья, спешим вам сообщить приятную новость. С 8 ноября 2014 на территории ЖК &laquo;София от Мартынова&raquo; открыл свои двери новый фитнес клуб &laquo;София sport&raquo;.&nbsp; Фитнес-клуб &laquo;София sport&raquo; - это спортивный комплекс для всей семьи, площадью целых...</p>\r\n\r\n<p>Дорогие друзья, спешим вам сообщить приятную новость. С 8 ноября 2014 на территории ЖК &laquo;София от Мартынова&raquo; открыл свои двери новый фитнес клуб &laquo;София sport&raquo;.&nbsp; Фитнес-клуб &laquo;София sport&raquo; - это спортивный комплекс для всей семьи, площадью целых...</p>\r\n\r\n<p>Дорогие друзья, спешим вам сообщить приятную новость. С 8 ноября 2014 на территории ЖК &laquo;София от Мартынова&raquo; открыл свои двери новый фитнес клуб &laquo;София sport&raquo;.&nbsp; Фитнес-клуб &laquo;София sport&raquo; - это спортивный комплекс для всей семьи, площадью целых...</p>\r\n\r\n<p>Дорогие друзья, спешим вам сообщить приятную новость. С 8 ноября 2014 на территории ЖК &laquo;София от Мартынова&raquo; открыл свои двери новый фитнес клуб &laquo;Со