INSERT INTO `complex` VALUES (1,1,'ЖК Мартынов','jk-martinov','a:2:{s:4:\"file\";s:54:\"/uploads/2a/f0/a4/2af0a43d-9fbd-4e1e-ae75-b6eb9ff785ec\";s:3:\"ext\";s:4:\".png\";}','<p>\n        С каждым днем все большее число коренных жителей и гостей столицы Украины предпочитают покупать современные квартиры в Киеве. При этом наибольшим спросом пользуются новостройки в пригороде столицы. К таким постройкам относят жилые комплексы в Борщаговке. Не меньшим спросом пользуются новостройки от Мартынова. Если вы хотите купить квартиру в Киеве, то по мнению большинства экспертов, одним из самых оптимальных вариантов покупки нового жилья от застройщика являются апартаменты в ЖК «София» от Мартынова.\n    </p>','2016-08-01 17:40:51','2016-10-04 18:45:34',3,'a:2:{s:4:\"file\";s:61:\"/uploads/images/6f/94/68/6f9468b1-20f8-4f67-bebd-4ce82bea5ade\";s:3:\"ext\";s:4:\".png\";}','a:2:{s:4:\"file\";s:61:\"/uploads/images/18/95/fd/1895fdbd-d8f1-4c41-a628-cfec371ff85c\";s:3:\"ext\";s:4:\".jpg\";}'),(2,1,'ЖК Клубный','jk-klubniy','a:2:{s:4:\"file\";s:61:\"/uploads/images/ee/89/94/ee8994cd-7824-42ae-8587-7091e9b8648b\";s:3:\"ext\";s:4:\".png\";}','<p>\n        С каждым днем все большее число коренных жителей и гостей столицы Украины предпочитают покупать современные квартиры в Киеве. При этом наибольшим спросом пользуются новостройки в пригороде столицы. К таким постройкам относят жилые комплексы в Борщаговке. Не меньшим спросом пользуются новостройки от Мартынова. Если вы хотите купить квартиру в Киеве, то по мнению большинства экспертов, одним из самых оптимальных вариантов покупки нового жилья от застройщика являются апартаменты в ЖК «София» от Мартынова.\n    </p>','2016-08-01 17:40:51','2016-10-04 18:46:27',1,NULL,'a:2:{s:4:\"file\";s:54:\"/uploads/31/fd/34/31fd3458-5af0-4e34-b3a5-0e2dc1200c6f\";s:3:\"ext\";s:4:\".jpg\";}'),(3,0,'ЖК Элитный','jk-elitniy',NULL,'<p>\n        С каждым днем все большее число коренных жителей и гостей столицы Украины предпочитают покупать современные квартиры в Киеве. При этом наибольшим спросом пользуются новостройки в пригороде столицы. К таким постройкам относят жилые комплексы в Борщаговке. Не меньшим спросом пользуются новостройки от Мартынова. Если вы хотите купить квартиру в Киеве, то по мнению большинства экспертов, одним из самых оптимальных вариантов покупки нового жилья от застройщика являются апартаменты в ЖК «София» от Мартынова.\n    </p>',NULL,NULL,1,NULL,NULL);
