  `slug` varchar(250) COLLATE utf8_unicode_ci NOT NULL,
  `image` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `content` text COLLATE utf8_unicode_ci,
  `lat` decimal(12,9) DEFAULT NULL,
  `lon` decimal(12,9) DEFAULT NULL,
  `is_rent` smallint(6) NOT NULL DEFAULT '0',
  `is_installments` smallint(6) NOT NULL DEFAULT '0',
  `parking` varchar(150) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `floors` int(11) NOT NULL DEFAULT '1',
  `building_type` smallint(6) DEFAULT NULL,
  `transport` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `to_stop` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `completion_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `created_at` timestamp NULL DEFAULT NULL,
