  `decoration` smallint(6) DEFAULT '0',
  `flats` smallint(6) DEFAULT '0',
  `class` smallint(6) DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `houses_street_id_foreign` (`street_id`),
  KEY `houses_complex_id_foreign` (`complex_id`),
  KEY `houses_number_index` (`number`),
  KEY `houses_slug_index` (`slug`),
  KEY `houses_is_rent_index` (`is_rent`),
  KEY `houses_is_installments_index` (`is_installments`),
  KEY `houses_parking_index` (`parking`),
  KEY `houses_floors_index` (`floors`),
  KEY `houses_completion_at_index` (`completion_at`),
  KEY `houses_manager_id_foreing_idx` (`manager_id`),
  CONSTRAINT `houses_complex_id_foreign` FOREIGN KEY (`complex_id`) REFERENCES `complex` (`id`),
  CONSTRAINT `houses_street_id_foreign` FOREIGN KEY (`street_id`) REFERENCES `streets` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
