INSERT INTO `houses` VALUES (1,1,1,'11',1,16,'Дом по улице Леси Украинки, 11','dom-lesi-ukrainki-11','a:2:{s:4:\"file\";s:61:\"/uploads/images/f0/1c/52/f01c524f-f0ba-4119-a0f0-d5e6b07bcc08\";s:3:\"ext\";s:4:\".jpg\";}','<h2>Описание дома</h2>\r\n\r\n<p>Дом на ул. Леси Украинки 11 один из первых в ЖК &laquo;София&raquo; был выставлен в 2009-м году. 5-тиэтажка из красного кирпича имеет цоколь и мансарду. Стены утеплены 6-ти см пенополистиролом. Между этажами установлены массивные монолитные перекрытия.</p>\r\n\r\n<p>Всего в доме 186 квартир, включая двухуровневые. Удобное расположение, до остановки всего 10 метров. В здании есть ПриватБанк, НоваяПочта и Софиевский ЖЕК. Предусмотрен подземный паркинг и свободная наземная парковка. Сдаются квартиры одно- и двухкомнатные, многоуровневые, а также офисные помещения на цоколе. Размер площади от 40-180 кв.м.</p>\r\n\r\n<h2>Квартиры в наличии</h2>\r\n\r\n<p>однокомнатные 42-58 кв.м<br />\r\nдвухкомнатные 60-80 кв.м<br />\r\nдвухуровневые 90-160 кв.м.<br />\r\nнежилые помещения от 40 до 180 кв.м.</p>\r\n',NULL,NULL,1,1,'Подземная + наземная',5,1,'','10 метров','2009-01-01 05:00:00',NULL,'2016-12-13 13:34:18',2,186,1),(2,1,1,'6',1,21,'Дом по улице Леси Украинки, 6','dom-lesi-ukrainki-6','a:2:{s:4:\"file\";s:61:\"/uploads/images/6a/bb/df/6abbdfb4-76fb-4608-96e6-f97d2977c53a\";s:3:\"ext\";s:4:\".jpg\";}','<h2>Описание дома</h2>\r\n\r\n<p>В доме жилищного комплекса &laquo;София&raquo; на ул. Леси Украинки 6 открыта продажа квартир и помещений. В наличии одно-, двух- и трехкомнатные площадью от 40-х до 165-ти кв. м. Был отдан в эксплуатацию всего 6 лет назад, в 2010-м году.</p>\r\n\r\n<p>У 5-тиэтажки удобное расположение. Общественный транспорт останавливается недалеко от дома. На 1-м этаже расположены магазины, кафе и свободное пространство для работы и отдыха. Рядом построена современная детская площадка с горками и качелями.</p>\r\n\r\n<p>Вы хотите открыть собственное заведение или коммерческое предприятие? Приобретайте нежилые помещения по доступным ценам.</p>\r\n\r\n<h2>Квартиры в наличии</h2>\r\n\r\n<p>однокомнатные 42-58 кв.м<br />\r\nдвухкомнатные 60-80 кв.м<br />\r\nдвухуровневые 90-160 кв.м.<br />\r\nнежилые помещения от 40 до 180 кв.м.</p>\r\n',NULL,NULL,1,3,'подземный + наземный',5,1,'','20 метров','2010-01-01 05:00:00',NULL,'2016-12-13 13:35:14',2,190,1),(3,1,3,'5',1,2,'Дом по улице Ивана Франка, 5','dom-ivana-franka-5','a:2:{s:4:\"file\";s:61:\"/uploads/images/47/82/29/4782291d-fba6-4744-93db-ead3598211a9\";s:3:\"ext\";s:4:\".jpg\";}','<h2>Описание дома</h2>\r\n\r\n<p>Если вы ищете подходящее жилье для семьи, оцените дом на Ивана Франка, 5.Его сдали в эксплуатацию в 2010 году, а при строительстве ориентировались на европейские показатели качества: стены утеплены пенополистиролом, между этажей установлены специальные перекрытия. В доме есть подземный паркинг и надземная стоянка.</p>\r\n\r\n<p>В многоэтажке 142 квартиры, 12 цокольных помещений. Отличительная особенность дома &ndash; двухуровневые квартиры, расположенные на пятом этаже. Причем у каждой квартиры есть мансарда.</p>\r\n\r\n<p>У строения выгодное месторасположение. Он находится всего в 60 метрах от остановки общественного транспорта.</p>\r\n\r\n<h2>Квартиры в наличии</h2>\r\n\r\n<p>однокомнатные 42-58 кв.м<br />\r\nдвухкомнатные 60-80 кв.м<br />\r\nдвухуровневые 90-160 кв.м.</p>\r\n',NULL,NULL,1,3,'подземная + наземная',5,1,'','60 метров','2010-01-01 05:00:00',NULL,'2016-12-13 13:49:04',2,142,1),(4,1,5,'14',1,0,'Дом по улице Боголюбова, 14','dom-bogolyubova-14','a:2:{s:4:\"file\";s:61:\"/uploads/images/26/9d/02/269d028f-7c02-4018-9b57-f28e543beb4d\";s:3:\"ext\";s:4:\".jpg\";}','<p>Дом Боголюбова 14 &ndash; это 11-этажная постройка с цокольным ярусом, завершенная в 2011 году. На последних уровнях расположены двухэтажные квартиры. Они подготовлены к ремонту и оснащены всем необходимым: счетчики на воду и газ, металлопластиковые окна, входные двери, сантехника, проводка, штукатурка и стяжка на полу.</p>\r\n\r\n<p>Общий жилой размер - от 43,9 кв. м и более. Строение из белого кирпича с утепленными стенами и паркингом. До ближайшей остановки &ndash; около 100 метров. Рядом размещены торговые точки, оборудована песочница с горками и качели. Нежилые помещения сдаются в коммерческих целях.</p>\r\n',NULL,NULL,1,3,'наземная',11,1,'','100 метров','2011-01-01 05:00:00',NULL,'2016-12-13 14:00:10',2,200,1),(5,1,5,'16',1,0,'Дом по улице Боголюбова, 16','dom-bogolyubova-16','a:2:{s:4:\"file\";s:61:\"/uploads/images/eb/7b/64/eb7b64fd-e6d6-4f4d-b956-46ae56824007\";s:3:\"ext\";s:4:\".jpg\";}','<p>Дом Боголюбова 16 &ndash; это комплекс одно- и двух- комнатных жилищ. Последние этажи занимают двухуровневые помещения, которые полностью подготовлены к ремонту. Параметры площадей жилья &ndash; от 44 кв. м и более. При стройке использовался белый кирпич и монолитные плиты. Снаружи &ndash; утепляющая прослойка пенополистирола в 12 см.</p>\r\n\r\n<p>Здание сдано в 2012 году. Нижний цоколь &ndash; нежилой. В нем находятся многочисленные магазин, салон красоты, контора нотариуса. Свободное место сдается в аренду. Рядом находится детская площадка, спортзал, футбольное поле, развлекательный центр. Имеются парковочные места. Вблизи проходят маршруты автобусов.</p>\r\n',NULL,NULL,1,3,'наземная',11,1,'','80 метров','2012-01-01 05:00:00',NULL,'2016-12-13 14:00:54',2,118,1),(9,1,5,'18',1,0,'Дом по улице Боголювова, 18','dom-bogolyubova-18','a:2:{s:4:\"file\";s:61:\"/uploads/images/53/3c/26/533c2617-cbbb-46cd-a98f-7c03e132c5fe\";s:3:\"ext\";s:4:\".jpg\";}','<p>Дом Боголюбова 18, сданный под заселение весной 2012, выстроен вблизи транспортной развязки. В шаговой доступности наземный паркинг, развлекательные и спортивные центры. В цокольном помещении расположены офисы, возможна аренда площадей. Жилье размером от 44 до 106 кв. м. включает в себя одно-, двух-, трехкомнатные квартиры, заселенность которых составляет 95%. Под крышей размещены двухуровневые апартаменты.</p>\r\n\r\n<p>Все квартиры подготовлены для проведения вашего ремонта и оборудованы котлами, счетчиками, оконными рамами. Внешние стены утеплены, а территория охраняется и убирается.</p>\r\n',NULL,NULL,1,3,'наземная',11,1,'','100-150 метров','2012-01-01 05:00:00','2016-09-30 16:21:19','2016-12-13 14:01:27',2,256,1),(10,1,5,'20',1,0,'Дом по улице Боголюбова, 20','dom-bogolyubova-20','a:2:{s:4:\"file\";s:61:\"/uploads/images/96/0b/24/960b2489-cee2-482b-a4a3-7f06d538758b\";s:3:\"ext\";s:4:\".jpg\";}','<p>Дом Боголюбова 20 спроектирован под квартиры разной площади. Однокомнатные занимают 44 кв. м., двухкомнатные &ndash; 74 кв. м. Также имеются двухуровневые мансарды и цокольный этаж. В нем расположены магазины, офисы, салон красоты. Свободные помещения нижнего уровня сдаются в аренду.</p>\r\n\r\n<p>Около жилого комплекса находится парковка, остановка, игровая зона для детей, центры досуга. Каждое жилье имеет счетчики на газ и воду, металлопластиковые окна с двухкамерным стеклопакетом, входные двери, электрическую проводку, сантехнику, газовый котел. Стены оштукатурены, выполнена бетонная стяжка.</p>\r\n',NULL,NULL,1,3,'наземная',11,1,'','100 - 150 метров','2012-01-01 05:00:00','2016-09-30 16:32:56','2016-12-13 14:02:03',2,229,1),(11,1,1,'20',1,0,'Дом по улице Леси Украинки, 20','dom-po-ulice-lesi-ukrainki','a:2:{s:4:\"file\";s:61:\"/uploads/images/e9/7a/47/e97a479a-7ce7-432c-87f1-48140a3cd2f4\";s:3:\"ext\";s:4:\".jpg\";}','<p>Дом Леси Украинки 20 &ndash; это Т-образный жилой комплекс. Квартиры разного метража и планировки. Всего насчитывается 10 уровней, последние из которых занимают двухъярусные апартаменты. Жил ой массив рассчитан на 228 жилищ, готовых к проведению ремонта.</p>\r\n\r\n<p>В них были проведены все базовые работы: штукатурка, бетонная стяжка, установка металлопластиковых окон, прочных дверей, утепление внешних стен. Площадь &ndash; от 44 кв. м. К преимуществам относится близость транспортной развязки, магазинов, развлекательных заведений, спортивные залы. Есть своя парковка и детская зона.</p>\r\n',NULL,NULL,1,3,'ная свободная парковка ',11,1,'','100-150 м','2012-01-01 05:00:00','2016-10-17 14:02:00','2016-12-13 14:02:36',1,232,1),(12,1,6,'30',1,0,'Дом по улице Мира, 30','dom-mira-30','a:2:{s:4:\"file\";s:61:\"/uploads/images/6a/45/3b/6a453be2-0418-4ca3-be94-452ab9dfc8b4\";s:3:\"ext\";s:4:\".jpg\";}','<p>Дом Мира 30 спроектирован в Т-образном виде, что дало возможность создать уникальную планировку. Параметры каждого жилого помещения начинаются от 44 кв. м. Имеются одно-, двух-и трехкомнатные варианты. Верхние ярусы представляют собой двухэтажную мансарду, а в основании постройки расположен цоколь с магазинами, салоном красоты, конторой нотариуса.</p>\r\n\r\n<p>Жилье подготовлено к декоративному ремонту, имеет счетчики, газовый котел, металлопластиковые окна, качественные двери. Территория комплекса находится под охраной и убирается. К услугам жильцов свободный паркинг. Стройка была окончена в 2013 и на данный момент комплекс заселен на 98%</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',11,1,'','100-150 метров','2013-01-01 05:00:00','2016-10-17 15:53:03','2016-12-13 14:03:14',1,188,1),(13,1,6,'36',1,0,'Дом по улице Мира, 36','dom-mira-36','a:2:{s:4:\"file\";s:61:\"/uploads/images/70/b1/7d/70b17da7-d816-4d21-a4a4-01c9d8294de0\";s:3:\"ext\";s:4:\".jpg\";}','<h2>Описание дома</h2>\r\n\r\n<p>С 2013-го в доме на улице Мира 36 идет активная продажа и сдача квартир. На данный момент заселен более чем на 90%. Всего на 11-ти этажах 188 квартир, а так же нежилые помещения на цоколе. Возможна покупка в рассрочку. Квартиры продаются без ремонта! В каждой установлены металлопластиковые окна, разводка электричества и сантехники, газовый котел и отопительная система.</p>\r\n\r\n<p>Есть наземный и подземный паркинг. Практически под домом останавливается общественный транспорт. На первом этаже здания работает несколько магазинов, кафе, полиграфия, салон красоты, стоматологический кабинет, мебельный, кофейня и автомат с питьевой водой.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка',11,1,'','100-150 метров','2013-01-01 05:00:00','2016-10-17 16:09:49','2016-12-13 13:36:02',1,188,1),(14,1,6,'27',1,0,'Дом по улице Мира, 27','dom-mira-27','a:2:{s:4:\"file\";s:61:\"/uploads/images/52/44/41/524441bf-a71c-4cd8-b469-cb496f49142f\";s:3:\"ext\";s:4:\".jpg\";}','<h2>Описание дома</h2>\r\n\r\n<p>Сдаются квартиры и цокольные помещения. Всего в доме на улице Мира 27 &ndash; 107 квартир и 5 нежилых помещений. Продаются без ремонта. 10-ти этажное здание построено из белого кирпича.</p>\r\n\r\n<p>Утепленные стены, удобная планировка и просторные метражи. При этом стены в доме отштукатурены, установлен двухкамерный стеклопакет, батареи, счетчики, бронированная входная дверь. Проведена сантехника и электрика.</p>\r\n\r\n<p>На территории ЖК София работают магазины, кафе, построена детская площадка, музыкальный фонтан, сделано ландшафтное покрытие.</p>\r\n\r\n<p>Приобрести жилье можно в рассрочку или полным платежом.</p>\r\n',NULL,NULL,1,1,'наземная свободная парковка ',11,1,'','100-150 метров','2013-01-01 05:00:00','2016-10-17 16:20:14','2016-12-13 13:36:53',1,107,1),(15,1,1,'26',1,0,'Дом по улице Леси Украинки, 26','dom-lesi-ukrainki-26','a:2:{s:4:\"file\";s:61:\"/uploads/images/37/24/63/37246373-cc4d-432c-8a41-372ac2af79bd\";s:3:\"ext\";s:4:\".jpg\";}','<h2>Описание дома</h2>\r\n\r\n<p>В аренду сдаются помещения под офис в жилом доме на ул. Леси Украинки 26. Расположенные в цоколе они подходят для открытия кафе, магазина, салона красоты или кабинета под свой бизнес. В одном ЖК комплексе вы получаете жилье и место для работы одновременно!</p>\r\n\r\n<p>В продаже квартиры разной планировки, а так же двухуровневые с лоджией. В Софиевском ЖК на Борщаговке зимние холода вас не побеспокоят. В каждой из них установлены батареи и металлопластиковые окна с двухкамерным стеклопакетом. Стены дома утеплены 12-ти см слоем пенополестирола. Дополнительная теплоизоляция достигается благодаря монолитным межэтажным перекрытием.</p>\r\n',NULL,NULL,1,1,'наземная свободная парковка ',11,1,'','100-150 метров','2013-01-01 05:00:00','2016-10-17 17:16:37','2016-12-13 13:37:34',1,152,1),(16,1,1,'28',1,0,'Дом по улице Леси Украинки, 28','dom-lesi-ukrainki-28','a:2:{s:4:\"file\";s:61:\"/uploads/images/31/ea/f2/31eaf231-5664-4f7e-9346-a41368cc901a\";s:3:\"ext\";s:4:\".jpg\";}','<p>Дом по адресу ул. Леси Украинки 28 был построен и сдан в 2013-м году. Является частью элитного ЖК София в Борщаговском районе Киева. Более 90% уже заселено.</p>\r\n\r\n<p>Имеет 11 этажей, плюс цоколь. Там расположены и сдаются под аренду нежилые помещения под офисы, магазины, заведения и т.п. На 10-11-м этажах в основном двухуровневые квартиры. Планировкой предусмотрена открытая лоджия, спальня, гостиная, ванная комната и просторная кухня.</p>\r\n\r\n<p>Квартиры продаются в только отстроенном состоянии, без ремонта. Стены отштукатурены, натянут потолок, установлены стеклопакеты, двери. Везде проведена электрика и санузел.</p>\r\n',NULL,NULL,1,3,'наземный свободная парковка',11,1,'','100-150 метров','2013-01-01 05:00:00','2016-11-02 11:04:50','2016-12-13 13:38:34',1,171,1),(17,1,1,'12',1,0,'Дом по улице Леси Украинки, 12','dom-lesi-ukrainki-12','a:2:{s:4:\"file\";s:61:\"/uploads/images/0c/20/42/0c204271-e854-4d92-99b0-7f69853ce30c\";s:3:\"ext\";s:4:\".jpg\";}','<p>В сердце ЖК &laquo;София&raquo; расположен дом на ул. Леси Украинки 12. Был отстроен одним из последних и сдан в 2014-м году.</p>\r\n\r\n<p>В отличие от остальных домов в данном комплексе не имеет цоколя и двухуровневых квартир. На первом находится элитный фитнес клуб &laquo;София Спорт&raquo;. Оснащен тренажерным залом, кардио зоной, бассейном и фитнес баром. В клубе несколько видов групповых занятий, профессиональные инструктора и оборудование.</p>\r\n\r\n<p>Удобная транспортная развязка. До остановки буквально 2-3 минуты ходу. Для автомобиля на территории жилищного комплекса есть просторный паркинг и подземная парковка.</p>\r\n',NULL,NULL,0,3,'наземная свободная парковка ',9,1,'','100-150 метров','2014-01-01 05:00:00','2016-11-02 11:10:15','2016-12-13 13:39:26',1,95,1),(18,1,3,'15',1,0,'Дом по улице Ивана Франка, 15/44','dom-ivana-franka-15-44','a:2:{s:4:\"file\";s:61:\"/uploads/images/fd/71/66/fd716614-e0ac-4789-a127-00fcc46d90e1\";s:3:\"ext\";s:4:\".jpg\";}','<p>Элитный дом с витражными окнами и лепниной на ул. Ивана Франка 15/44 был достроен в 2014-м году. В нем 9 этажей плюс цоколь. Жилых квартир &ndash; 80, есть так же помещения под офисы на цоколе и первом этаже, которые сдаются в аренду жителям Киева.</p>\r\n\r\n<p>ЖК &laquo;София&raquo; считается лучшим элитным комплексом на Борщаговке. Он находится недалеко от транспортной развязки. Имеет развитую инфраструктуру &ndash; кафе, магазины, салоны, фитнес центр, парковку. Для детей оборудован ландшафт и игровая площадка. Дети могут заниматься теннисом, плаваньем в бассейне или играть в футбол на поле недалеко от дома.</p>\r\n\r\n<p>Можно оплатить недвижимость полностью. Или же взять в рассрочку сроком до 3-х лет.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',9,1,'','100-150 метров','2014-01-01 05:00:00','2016-11-02 11:14:49','2016-12-13 14:14:25',1,80,1),(19,1,7,'80',1,0,'Дом по улице Толстого, 80','dom-tolstogo-80','a:2:{s:4:\"file\";s:61:\"/uploads/images/d7/3b/a6/d73ba642-4827-486f-81ce-628bef0ae49a\";s:3:\"ext\";s:4:\".jpg\";}','<p>В доме на ул. Толстого 80 &ndash; 11 этажей. До 9-го находятся только однокомнатные квартиры, выше &ndash; двухуровневые. В каждой монолитный потолок, отштукатурены стены, проведено электричество и санузел. Установлены металлопластиковые окна, газовый котел для нагрева воды и батареи. В новострое нет квартир на продажу с ремонтом.</p>\r\n\r\n<p>Фасад дома оформлен в пастельных тонах персикового цвета. Стены построены из белого кирпича и утеплены пенополистиролом.</p>\r\n\r\n<p>Дополнительный стимул приобрести недвижимость в Софиевском ЖК &ndash; круглосуточная охрана территории. Это касается людей, которые заходят на территорию ЖК, в подъезд, а так же парковки и автомобилей.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',11,1,'','100-150 метров','2013-01-01 05:00:00','2016-11-02 11:21:23','2016-12-13 13:41:17',1,80,1),(20,1,7,'84',1,0,'Дом по улице Толстого, 84','dom-tolstogo-84','a:2:{s:4:\"file\";s:61:\"/uploads/images/02/c6/15/02c61560-9c28-4f2c-a31a-b20f06a96634\";s:3:\"ext\";s:4:\".jpg\";}','<p>В доме на ул. Толстого 84 открыта продажа квартир и аренда помещений. Был сдан в эксплуатацию относительно недавно, в 2014-м году. Дом быстро нашел своих жильцов и сейчас заселено более 90%.</p>\r\n\r\n<p>До 9-го этажа на каждом по 8-мь однокомнатных. Выше &ndash; двухуровневые апартаменты с лоджией и трехкомнатные. Под офис можно арендовать одно из 4-х цокольных помещений.</p>\r\n\r\n<p>На территории жилищного комплекса обширная развлекательная детская зона. Есть садово-парковая зона с фонтаном. В территориальной близости продуктовые магазины, мебельные и обувные салоны, парикмахерская, фитнес-центр, кофейни и прочее.</p>\r\n\r\n<p>Территория ЖК тщательно охраняется.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',11,1,'','100-150 метров','2014-01-01 05:00:00','2016-11-02 11:32:47','2016-12-13 13:42:13',1,80,1),(21,1,7,'88',1,0,'Дом по улице Толстого, 88','dom-tolstogo-88','a:2:{s:4:\"file\";s:61:\"/uploads/images/8c/33/0a/8c330ab4-481f-4bdd-b98a-b89c51459968\";s:3:\"ext\";s:4:\".jpg\";}','<p>Продажа жилья и помещений в доме на ул. Толстого 88 началась пару лет назад, в 2014-м году. Всего в доме 11 этажей и цоколь. Жилье можно не только купить, но и арендовать.</p>\r\n\r\n<p>Все квартиры сдаются с ремонтом! Это большая редкость для новостроек такого типа. Здание утеплено пенополистиролом и межэтажными перекрытиями.</p>\r\n\r\n<p>Пол в квартире уложен плиткой в кухне, ванной и коридоре, в остальных комнатах &ndash; ламинат. Стены заштукатурены и окрашены или же обклеены обоями. Комнаты полностью укомплектованы мебелью &ndash; шкафы, стулья, столы, лампы. Установлены смесители, счетчики, котел для подогрева воды и стиральная машинка. На кухне есть холодильная камера и плита.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',11,1,'','100-150 метров','2014-01-01 05:00:00','2016-11-02 11:35:48','2016-12-13 13:43:53',2,80,1),(22,1,6,'31',1,0,'Дом по улице Мира, 31','dom-mira-31','a:2:{s:4:\"file\";s:61:\"/uploads/images/43/34/ae/4334aebe-7906-4ea6-8ea8-5c07a853a909\";s:3:\"ext\";s:4:\".jpg\";}','<p>В доме по адресу ул. Мира 31 продаются квартиры метражом от 40-ка кв. м. Планировка разная &ndash; одно, двух и трехкомнатные. На нижнем этаже разместились магазины, офисы, заведения и прочие коммерческие предприятия.</p>\r\n\r\n<p>Изначально установлены счетчики на газ, электричество и воду. Проведена сантехника и электрика. В ванной есть двухконтурный газовый котел для воды. В комнатах встроены батареи. Стены утеплены 12-ти см слоем специального строительного материала.</p>\r\n\r\n<p>Во дворе расположен фонтанчик, детская площадка, аллеи с цветочными клумбами. Территория ЖК всегда хорошо освещена и находится под охраной.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',11,1,'','100-150 метров','2013-01-01 05:00:00','2016-11-02 11:38:49','2016-12-13 13:44:44',1,108,1),(23,1,6,'35',1,0,'Дом по улице Мира, 35','dom-mira-35','a:2:{s:4:\"file\";s:61:\"/uploads/images/16/41/32/16413282-2421-4853-b756-e36e7c14a96f\";s:3:\"ext\";s:4:\".jpg\";}','<p>В многоэтажном доме на ул. Мира 35 продаются квартиры с весны 2015-го года. Большинство окон выходят на садово-парковую зону и игровую площадку. Вы можете каждое утро любоваться превосходным видом. Наблюдать за своим ребенком, пока он играет с друзьями во дворе.</p>\r\n\r\n<p>Безопасность ЖК &laquo;София&raquo; обеспечивает специализированная система охраны. Она контролирует все перемещения по территории жилищного комплекса и возле него.</p>\r\n\r\n<p>Недалеко от дома проезжает маршрутка до Киева. В отличие от центра столицы воздух в Борщаговском районе гораздо чище. Плотность транспорта на Борщаговке в сравнении значительно снижена.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',11,1,'','100-150 метров','2014-01-01 05:00:00','2016-11-02 11:42:11','2016-12-13 13:45:38',1,116,1),(24,1,6,'41',1,0,'Дом по улице Мира, 41','dom-mira-41','a:2:{s:4:\"file\";s:61:\"/uploads/images/fe/80/43/fe8043c1-e40e-4abf-8fd1-b6b607353adb\";s:3:\"ext\";s:4:\".jpg\";}','<p>Дом на ул. Мира 41 относится к ЖК &laquo;София&raquo; в Борщаговском районе. В первом подъезде продаются однокомнатные квартиры с ремонтом. Имеются так же трехкомнатные и двухкомнатные, но без ремонта.</p>\r\n\r\n<p>В них установлены бронированные двери, двойной стеклопакет металлопластиковых окон, установлена проводка и санитарный узел.</p>\r\n\r\n<p>На первых этажах расположены магазины продуктов, одежды, кофейни, пиццерия, фитнес центр и прочие предприятия. Есть зеленая зона и детская площадка. Территория жилищного комплекса контролируется надеждой системой охраны. По всей территории установлено освещение и камеры.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',11,1,'','100-150 метров','2014-06-01 04:00:00','2016-11-02 11:47:23','2016-12-13 13:46:33',2,249,1),(25,1,6,'40',1,0,'Дом по улице Мира, 40','dom-mira-40','a:2:{s:4:\"file\";s:61:\"/uploads/images/78/07/f9/7807f9c9-41b2-4595-bcb5-7bbbbdf2f19a\";s:3:\"ext\";s:4:\".jpg\";}','<p>В доме на ул. Мира 40 на верхних этажах расположены двухуровневые квартиры. На 2-м &ndash; большие террасы.</p>\r\n\r\n<p>Квартиры по этому адресу продаются с 2014-го года. Дом является частью современного ЖК новостроек &laquo;София&raquo; в Борщаговском районе Киева. Добираться до центра столицы легко и быстро. Общественный транспорт останавливается прямо возле жилищного комплекса.</p>\r\n\r\n<p>Для автомобилей есть удобный паркинг и просторная подземная парковка. На территории есть парковая и детская развлекательная зона. Охраной территории занимаются профессионалы.</p>\r\n\r\n<p>Возможна покупка недвижимости в рассрочку. Условия аренды и продажи узнавайте по телефону.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',11,1,'','100-150 метров','2013-01-01 05:00:00','2016-11-02 11:47:56','2016-12-13 13:47:25',1,207,1),(26,1,6,'46',1,0,'Дом по улице Мира, 46','dom-mira-46','a:2:{s:4:\"file\";s:61:\"/uploads/images/5f/a5/89/5fa5897e-d59b-43c0-abd8-ac412e321883\";s:3:\"ext\";s:4:\".jpg\";}','<p>Покупка в доме на Мира, 46 &ndash; выгодная инвестиция для молодой семьи и всех, кто ценит уют и комфорт. Вы получите квартиру в строении еврокласса из белого кирпича, с утеплением из пенополистирола на 12 см и с прекрасны видом из окна: во внутреннем дворе расположены фонтаны, клумбы с цветами, на внешней &ndash; спортивная площадка. Возле строения обустроен наземный паркинг. Всего в 100 метрах от подъезда находится остановка общественного транспорта.</p>\r\n\r\n<p>Объект сдали в эксплуатацию в 2014 году. В доме 10 этажей и 11-й &ndash; цокольный 216 квартир и 16 цокольных помещений, расположенные на последних этажах.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',11,1,'','100-150 метров','2014-01-01 05:00:00','2016-11-09 18:29:19','2016-12-13 13:49:48',1,216,1),(27,1,6,'50',1,0,'Дом по улице Мира, 50','dom-mira-50','a:2:{s:4:\"file\";s:61:\"/uploads/images/af/50/6f/af506f84-63d5-44cf-9827-d17f0ff96e6a\";s:3:\"ext\";s:4:\".jpg\";}','<p>11-этажный дом, состоящий из 216 квартир и 14 цокольных помещений, станет отличным приобретением для преуспевающих молодых людей. В доме на Мира, 50 созданы комфортные условия: в квартирах тепло и уютно за счет того, что строение выполнено из белого кирпича, его стены утеплены пенополистиролом, имеются монолитные межэтажные перекрытия.</p>\r\n\r\n<p>В этом доме можно как купить жилплощадь, так и арендовать квартиры на цокольном этаже с готовой электропроводкой, пластиковыми окнами, напольной стяжкой, счетчиками газа и воды. Возле дома &ndash; наземный паркинг и детская площадка. Строение сдано в эксплуатацию в 2014 году.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',11,1,'','100-150 метров','2014-01-01 05:00:00','2016-11-09 18:30:55','2016-12-13 13:50:24',1,216,1),(28,1,7,'81',1,0,'Дом по улице Толстого, 81','dom-tolstogo-81','a:2:{s:4:\"file\";s:61:\"/uploads/images/e3/1e/29/e31e29fb-e132-4d8c-adb3-1ce7b722ec16\";s:3:\"ext\";s:4:\".jpg\";}','<p>Дом расположен в тихом и уютном районе Киева, неподалеку от продовольственных супермаркетов, детских садов, аптек, кафе. До остановки маршрутного такси 150 метров.</p>\r\n\r\n<p>В доме на Толстого, 81 121 квартира, 7 цокольных помещений. Всего 9 этажей и цокольный этаж Главное преимущество квартир &ndash; стены, утепленные пенополистиролом, и высокие потолки &ndash; 2,7 метра, что делает помещение более теплым, светлым и просторным. Возле дома есть наземный паркинг. В доме сдаются квартиры в отличном состоянии: с напольной стяжкой, стеклопакетом, электропроводкой в безупречном состоянии. Дом сдан в эксплуатацию в 2015 году.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',9,1,'','100-150 метров','2015-01-01 05:00:00','2016-11-09 18:33:00','2016-12-13 13:51:07',1,121,1),(29,1,8,'9',1,0,'Дом по улице Житняя, 9','dom-zhitnyaya-9','a:2:{s:4:\"file\";s:61:\"/uploads/images/fc/4f/09/fc4f09ee-9d12-4cc4-9329-9c830e651f9f\";s:3:\"ext\";s:4:\".jpg\";}','<p>Если вы в поисках комфортабельного жилья, оцените квартиры в доме на Житней, 9, который сдан в эксплуатацию в 2015 году. В строении 9 этажей и дополнительный &ndash; цокольный, 126 квартир, 23 кладовки, где можно хранить консервацию, спортивную экипировку, бытовую технику.</p>\r\n\r\n<p>Покупка или аренда жилой площади в этом доме &ndash; выгодно и практично: в основе конструкции &ndash; белый кирпич, стены утеплены пенополистиролом, установлено автономное отопление. Вы в значительной мере сократите расходы на оплату коммунальных счетов.</p>\r\n\r\n<p>В доме на Житней, 9 на первом этаже обустроены магазины, салон красоты, аптеки, а в шаговой доступности &ndash; детский сад и остановка общественного транспорта.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',9,1,'','100-150 метров','2015-01-01 05:00:00','2016-11-09 18:38:18','2016-12-13 13:51:46',1,126,1),(30,1,9,'12',1,0,'Дом по улице Братская, 12','dom-bratskaya-12','a:2:{s:4:\"file\";s:61:\"/uploads/images/83/3b/1f/833b1ffc-1dcf-4e8e-9348-dda92c04a383\";s:3:\"ext\";s:4:\".jpg\";}','<p>Покупка и аренда жилья в доме на Братской, 12 &ndash; верное решение для тех, кто ценит тепло и комфорт. В каждой из 144 квартир есть отдельная система отопления, электрическая проводка, счетчики электроэнергии и воды. Помимо жилых квартир в доме имеются 4 цокольных помещения и 30 кладовок.</p>\r\n\r\n<p>Главным преимуществом дома считаются бесшумные лифты и утепленные стены, которые создают комфортную температуру в помещении в осенне-зимний период. Возле дома расположены продуктовые супермаркеты, аптеки, детские сады и школы. Во внутреннем дворе строения обустроены детская и спортивная площадки. Дом сдан в эксплуатацию в 2015 году.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',9,1,'','100-150 метров','2015-01-01 05:00:00','2016-11-09 18:40:48','2016-12-13 13:52:21',1,144,1),(31,1,8,'7',1,0,'Дом по улице Житняя, 7','dom-zhitnyaya-7','a:2:{s:4:\"file\";s:61:\"/uploads/images/9a/74/de/9a74defe-52d2-4823-b963-d99e03c30f80\";s:3:\"ext\";s:4:\".jpg\";}','<p>Если вы ищете жилье в тихом и спокойном районе Киева, оцените одно- и двухкомнатные квартиры в доме на Житней, 7 с улучшенной планировкой, утепленными стенами и отличным видом из окна. В доме 9 основных этажей и 10-й &ndash; цокольный, 126 квартир и 7 цокольных помещений. Возле дома находится остановка маршрутного такси, возле новостройки есть детская и спортивная площадки, охраняемый наземный паркинг. Дом сдан в 2015 году.</p>\r\n\r\n<p>В настоящее время доступна покупка и аренда жилой площади с готовой электрической проводкой, счетчиками света и воды, металлопластиковыми окнами, а также нежилых помещений.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',9,1,'','100-150 метров','2015-01-01 05:00:00','2016-11-09 18:43:04','2016-12-13 13:52:54',1,126,1),(32,1,10,'20',1,0,'Дом по улице Счастливая, 20','dom-schastlivaya-20','a:2:{s:4:\"file\";s:61:\"/uploads/images/d2/35/62/d2356220-d39b-49a5-940f-ad3a06ccf167\";s:3:\"ext\";s:4:\".jpg\";}','<p>Для молодой семьи и успешных людей, которые ценят спокойствие, покупка квартиры в доме на Счастливой, 20 считается оптимальным вариантом. Вы получите жилье в благоустроенном районе: рядом с домом расположена остановка общественного транспорта, супермаркеты, аптеки, салоны красоты, фитнес-центры, где можно активно провести вечер после напряженного рабочего дня.</p>\r\n\r\n<p>В доме 9 этажей. Стены выполнены из белого кирпича, утеплены пенополистиролом. В квартирах установлены счетчики электроэнергии и воды, пластиковые окна, проведена электропроводка. Вы получите комфортабельное жилье в одном из лучших спальных районов столицы.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',9,1,'','100-150 метров','2015-01-01 05:00:00','2016-11-09 18:46:43','2016-12-13 13:53:31',1,121,1),(33,1,7,'71',1,0,'Дом по улице Толстого, 71','dom-tolstogo-71',NULL,'<p>Аренда квартиры в доме на Толстого, 71 подойдет молодым людям, парам с двумя-тремя детьми. Дом расположен в тихом и уютном районе столицы, всего в 150 метрах от остановки общественного транспорта. В квартирах есть все необходимое для проживания и учета коммунальных услуг (счетчики электроэнергии, газа и воды).</p>\r\n\r\n<p>В комнатах расставлена современная мебель, в ванной комнате &ndash; стиральная машина. Металлические входные двери станут преградой на пути злоумышленников. Пластиковые окна защитят жиле от постороннего шума и сквозняков. В аренду сдаются одно-, двух- и трехкомнатные квартиры.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',8,1,'','150-200 метров','2014-01-01 05:00:00','2016-11-09 18:49:33','2016-12-13 13:54:09',2,112,1),(34,1,9,'9',1,0,'Дом по улице Братская, 9','dom-bratskaya-9',NULL,'<p>Нужна квартира в спокойном районе Киева? Оцените жилую площадь в доме на Братской, 9. В новостройке, сданной в эксплуатацию в 2015 году, можно арендовать одно- и двухкомнатные квартиры с улучшенной планировкой, утепленными стенами, счетчиками газа, света и воды, бытовой техникой и мебелью, необходимой для комфортного проживания.</p>\r\n\r\n<p>В 150 метрах от дома находится остановка общественного транспорта, продуктовые супермаркеты, аптеки, детские сады. В квартирах установлена качественная сантехника, розетки и выключатели. Во внутреннем дворе обустроен наземный охраняемый паркинг, детская и спортивные площадки.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',8,1,'','150-200 метров','2015-01-01 05:00:00','2016-11-09 18:51:41','2016-12-13 13:54:50',2,64,1),(35,0,1,'41',1,0,'Дом по улице Леси Украинки, 41','dom-lesi-ukrainki-41',NULL,'<p>Квартиры в доме на Леси Украинки, 41, расположенном в спокойном спальном районе столицы, будет сданы в продажу в ближайшее время. Сегодня можно арендовать жилплощадь с мебелью, счетчиками электроэнергии и воды, бытовой техникой (газовым котлом, стиральной машиной).</p>\r\n\r\n<p>Предполагается, что в жилье будет комфортная температура воздуха в любое время года: строение выполнено из белого кирпича с обивкой из пенополистирола. Этот материал отлично удерживает тепло в зимний период, и сохраняет прохладу &ndash; летом. Дом находится в пешей доступности от остановки общественного транспорта, магазинов, детских садов, аптек.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',8,1,'','100-150 метров','2015-01-01 05:00:00','2016-11-09 18:54:06','2016-12-13 13:55:37',2,0,1),(36,0,8,'26',1,0,'Дом по улице Житняя, 26','dom-zhitnyaya-26',NULL,'<p>10-этажный новый дом на Житней, 26 сдан в эксплуатацию в 2015 году, но пока квартиры не выставлены на продажу. Строение выполнено из белого кирпича, стены утеплены пенополистиролом. На этажах установлены монолитные межэтажные перекрытия. В новостройке можно выбрать одно- и двухкомнатные квартиры, нежилые помещения, расположенные на цокольном этаже, для покупки и аренды.</p>\r\n\r\n<p>Дом на Житней, 26 находится в минуте ходьбы от остановки общественного транспорта. Возле строения есть магазины, аптеки, фитнес-центры, салоны красоты, обустроенная детская и спортивная площадки, наземная территория для парковки автомобилей.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',10,1,'','150-200 метров','2015-07-01 04:00:00','2016-11-09 18:55:45','2016-12-13 13:56:37',2,0,1),(37,1,7,'94',1,0,'Дом по улице Толстого, 94','dom-tolstogo-94','a:2:{s:4:\"file\";s:61:\"/uploads/images/18/89/e7/1889e724-ab13-4fb9-8184-02b217a86a9b\";s:3:\"ext\";s:4:\".jpg\";}','<p>Новый дом на Толстого, 94 сдан в эксплуатацию в 2016 году. В доме 9 этажей и 10-й &ndash; цокольный. На продажу выставлены одно-, двух- и трехкомнатные квартиры и дуплексы (двухуровневая жилая площадь) и нежилые помещения, расположенные на цокольном этаже. В квартирах установлены пластиковые окна, электрическая проводка, батареи, счетчики (электроэнергия, газ, вода).</p>\r\n\r\n<p>В квартирах готово напольное покрытие, стены отштукатурены. В 150 метрах от новостройки расположена остановка общественного транспорта, продуктовые магазины, аптеки. Во внутреннем дворе обустроен наземный паркинг, детская площадка.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',10,1,'','150-200 метров','2016-05-01 04:00:00','2016-11-09 18:58:36','2016-12-13 13:57:24',1,122,1),(38,1,9,'24',1,0,'Дом по улице Братская, 24','dom-bratskaya-24','a:2:{s:4:\"file\";s:61:\"/uploads/images/9e/77/72/9e777268-c8b5-491d-a135-546db01549be\";s:3:\"ext\";s:4:\".jpg\";}','<p>Аренда и покупка квартиры в новом доме на Братской, 24 &ndash; отличное решение для тех, кто любит спорт, удобство и комфорт. На первом этаже дома находится фитнес-центр &laquo;София Спорт&raquo;, во внутреннем дворе &ndash; обустроенная спортивная площадка. Выбрать одну-, двухкомнатную квартиру или дуплекс можно на любом из 9 этажей. На 10-м &ndash; цокольном этаже расположены нежилые помещения, которые сдаются в аренду.</p>\r\n\r\n<p>Главное преимущество новостройки &ndash; наличие в каждой квартире пластиковых окон с прочным стеклом, счетчиков света, газа, воды, электрической проводки и напольной стяжки. В 150 метрах от дома расположена остановка общественного транспорта.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',10,1,'','150-200 метров','2016-05-01 04:00:00','2016-11-09 19:00:53','2016-12-13 13:58:08',1,128,1),(39,1,11,'61',1,0,'Дом по улице Амосова, 61 ','dom-amosova-61',NULL,'<p>Новый дом на Амосова, 61 сдан в эксплуатацию в 2016 году. В новостройке выставлены на продажу и аренду одно-, двух- и трехкомнатные квартиры и дуплексы с металлопластиковыми окнами, счетчиками газа, электроэнергии, воды, напольной стяжкой, металлическими входными дверями.</p>\r\n\r\n<p>В числе преимуществ дома: утепление из пенополистирола, наличие нежилых помещений на цокольном этаже и межэтажных монолитных перекрытий. Возле дома обустроена наземная парковка. В 100 метрах от нового дома находится остановка общественного транспорта, в радиусе 300 метров &ndash; продуктовые магазины, аптеки, кафе, спортивные клубы.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',10,1,'','150-200 метров','2016-03-01 05:00:00','2016-11-09 19:06:18','2016-12-13 13:58:54',1,120,1),(40,1,8,'21',1,0,'Дом по улице Житняя, 21','dom-zhitnyaya-21',NULL,'<p>Дом Житняя 21 &ndash; современный жилой массив, работа над которым завершилась в 2016 году. В нем 9 этажей, 126 квартир, 7 цоколей и 23 кладовки. Двухкомнатное жилье площадью 67.8 кв. м, однокомнатное &ndash; 38.4. Каждая квартира подготовлена под ремонтные работы.</p>\r\n\r\n<p>Имеется газовый счетчик, газовый котел, стяжка на полу, металлопластиковые окна, батареи. Во время стройки использовался белый кирпич и монолитные плиты. Наружные стены оборудованы пенополестиролом для снижения расхода тепла. Цокольный этаж занят коммерческими заведениями, а свободное место сдается в аренду. До ближайшей остановки менее 100 метров.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',10,1,'','150-200 метров','2016-03-01 05:00:00','2016-11-09 19:11:54','2016-12-13 14:04:01',1,126,1),(41,1,8,'17',1,0,'Дом по улице Житняя, 17','dom-zhitnyaya-17',NULL,'<p>Сданный в первом квартале 2016 года, дом Житняя 17 имеет в планировке одно-, двухкомнатные и двухуровневое апартаменты, а также свободную территорию под офисы. На 10 этажах оборудовано 116 квартир и 23 кладовки. Жилые помещения утеплены и подготовлены к ремонту. Минимальная площадь &ndash; 44 кв. м., максимальная &ndash; 106.</p>\r\n\r\n<p>В цоколе находятся коммерческие организации: магазины, юридическая фирма. Зона вокруг строения убирается и находится под охраной. К постройке близко подходят транспортные маршруты автобусов &ndash; всего 150-200 метров. Вблизи располагается игровая площадка, парковка, спортивный зал.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',10,1,'','150-200 метров','2016-01-01 05:00:00','2016-11-09 19:13:21','2016-12-13 14:04:35',1,116,1),(42,1,7,'102',1,0,'Дом по улице Толстого, 102','dom-tolstogo-102',NULL,'<p>Семиэтажный дом Толстого 102 введен в эксплуатацию в начале 2016 года. Кроме жилых помещений на 1 и 2 комнаты, двухъярусных квартир, имеются нежилые. Они сдаются под офисы и магазины. Общее количество квартир &ndash; 96, метраж от 44 до 106 кв.м.</p>\r\n\r\n<p>На цокольном уровне 16 свободных площадок, доступных в аренду. При постройке здания использовались монолитные плиты перекрытий и белый кирпич. Для утепления применили пенополистирола 12 см. В максимальной близости расположены игровые зоны для детского досуга, торговые точки, спортивно-развлекательный комплекс. Доступен наземный паркинг.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',7,1,'','100-150 метров','2016-01-01 05:00:00','2016-11-09 19:14:55','2016-12-13 14:05:21',1,96,1),(43,1,5,'22',1,0,'Дом по улице Боголюбова, 22','dom-bogolyubova-22','a:2:{s:4:\"file\";s:61:\"/uploads/images/06/71/99/06719986-5f28-4206-bb62-95221d6bc17d\";s:3:\"ext\";s:4:\".jpg\";}','<p>Дом Боголюбова 22 начал заселяться в 2016 году. Он состоит из 10 этажей, 60 жилплощадей, 6 цоколей. Метраж жилых помещений начинается от 44 кв. м. В каждом помещении смонтированы металлопластиковые рамы, газовый котел, электрические разводки, сантехника.</p>\r\n\r\n<p>Используется энергосберегающее стекло. Здание выполнено из белого прочного кирпича, межуровневые перегородки &ndash; из монолитных плит. По внешней стороне утеплено. Ближайшая остановка расположена в нескольких минутах ходьбы. Поблизости есть игровые площадки, магазины, кафе, спортивный зал. Имеется наземный паркинг. Нулевой уровень сдается в аренду.</p>\r\n',NULL,NULL,1,3,'наземная',10,1,'','200 - 250 метров','2016-01-01 05:00:00','2016-11-09 19:17:28','2016-12-13 14:06:06',1,60,1),(44,1,5,'24',1,0,'Дом по улице Боголюбова, 24','dom-bogolyubova-24',NULL,'<p>Десятиэтажный дом Боголюбова 24, стройка которого окончена в 2016 году, имеет удобную планировку и расположение. В пешеходной близости располагаемся автобусная остановка, торгово-развлекательные центры, футбольное поле, детские качели и горки.</p>\r\n\r\n<p>К преимуществам относится просторная парковка, проведенные ремонтно-подготовительные работы в жилье, использование качественных материалов при постройке. 143 помещения подготовлены к грунтовке, поклейке обоев и переезду. Имеются бетонные стяжки, окна, счётчики газа, электричества, выполнена разводка электросетей, установлены двери.</p>\r\n',NULL,NULL,1,3,'наземная',10,1,'','200 - 250 метров','2016-01-01 05:00:00','2016-11-09 19:19:37','2016-12-13 14:07:05',1,60,1),(45,1,5,'26',1,0,'Дом по улице Боголюбова, 26','dom-bogolyubova-26',NULL,'<p>Девятиэтажная постройка &ndash; дом Боголюбова 26, рассчитан на 92 квартиры. Размеры от 44 кв. м. Мансардные апартаменты размером 106 кв. м. на последних этажах предусмотрены квартиры из нескольких ярусов. На нулевом уровне сдаются площади в коммерческих целях под офисы и учреждения.</p>\r\n\r\n<p>Жилые комнаты оборудованы всем необходимым: новые двери, счетчики, котел. Для косметического ремонта подготовлена штукатурка и бетонная стяжка на полу. Прилегающая территория охраняется и убирается, доступен бесплатный паркинг. В минутах пешей ходьбы расположена остановка автобуса, торговые точки, спортзал.</p>\r\n',NULL,NULL,1,3,'наземная',10,1,'','200 - 250 метров','2016-01-01 05:00:00','2016-11-09 19:21:26','2016-12-13 14:07:56',1,92,1),(46,1,5,'28',1,0,'Дом по улице Боголюбова, 28','dom-bogolyubova-28',NULL,'<p>Дом Боголюбова 28 располагает 75 квартирами, каждая из которых подготовлена к ремонту. Верхние ярусы занимает двухуровневое жилье. В цоколе &ndash; 5 нежилых помещений, свободных для аренды под офисы и друге учреждения. Рядом оборудована уютная детская площадка с песочницей, горками, качелями.</p>\r\n\r\n<p>Для автовладельцев в свободном доступе наземная парковка. Продуктовые магазины, ТРЦ, спортклуб находятся рядом. Для строительства, законченного в 2017 году, использовался белый кирпич, монолитные блоки, утеплитель стен. Установлены окна, котлы, сантехника, смонтирована электропроводка.</p>\r\n',NULL,NULL,1,3,'наземная',10,1,'','200 - 250 метров','2017-01-01 05:00:00','2016-11-09 19:22:55','2016-12-13 14:08:27',1,72,1),(47,1,5,'30',1,0,'Дом по улице Боголюбова, 30','dom-bogolyubova-30',NULL,'<p>Дом Боголюбова 30 вводится в эксплуатацию в 2017 году. На 9 этажах находятся 104 жилых квартиры. Последние ярусы отведены под двухуровневые апартаменты. По проекту имеются одно-, двух-, трехкомнатные квартиры.</p>\r\n\r\n<p>Планировка каждого помещения практична и удобна. Имеются все необходимые счетчики, штукатурка, стяжка, металлопластиковые оконные рамы, теплосберегающие стекла, разводка электрики, утеплитель стен. В ванных комнатах установлена сантехника. Цоколь сдается для коммерческих целей. У здания хорошая транспортная развязка. Дом имеет близость к магазинам, развлекательным заведениям, спортзалу.</p>\r\n',NULL,NULL,1,3,'наземная',10,1,'','250 - 300 метров','2017-01-01 05:00:00','2016-11-09 19:24:39','2016-12-13 14:09:01',1,104,1),(48,1,5,'32',1,0,'Дом по улице Боголюбова, 32','dom-bogolyubova-32',NULL,'<p>Дом Боголюбова 32 рассчитан на 64 квартиры, подготовленных к ремонту. В них установлены металлопластиковые оконные конструкции, энергосберегающие стеклопакеты, двери, штукатурка, стяжки. Планировка разделяется на одно-, двухкомнатные жилища, а также двухуровневые мансарды.</p>\r\n\r\n<p>Девятиэтажное здание выстроено из кирпича и монолитных плит. Дом утеплен пенополистиролом. На цокольном уровне находятся нежилые помещения, доступные к аренде. Все необходимые магазины, центры отдыха, детские площадки, остановка общественного транспорта расположены в пешеходной близости (150-200 метров).</p>\r\n',NULL,NULL,1,3,'наземная',10,1,'','250 - 300 метров','2017-01-01 05:00:00','2016-11-09 19:26:13','2016-12-13 14:09:34',1,64,1),(49,1,5,'34',1,0,'Дом по улице Боголюбова, 34','dom-bogolyubova-34',NULL,'<p>Современный жилой комплекс - дом Боголюбова 34, вытроен из белого кирпича, а межэтажные перекрытия выполнены из монолитных блоков. Внешние стены устелены прослойкой пенополистирола. Территория убирается и охраняется. Во двореесть детские горки, качели, песочница.</p>\r\n\r\n<p>Квартиры спланированы на одну и две комнаты, а также двухуровневые апартаменты. Площадь наименьшего жилья &ndash; 44 кв.м., наибольшего &ndash; около 106. Удобная и комфортная для жизни планировка. Стройка сдается в 2017 году. Здание имеет близкое расположение к ТРЦ, удобную транспортную развязку, спортивным и развлекательным центрам.</p>\r\n',NULL,NULL,1,1,'наземная',10,1,'','250 - 300 метров','2017-01-01 05:00:00','2016-11-09 19:27:28','2016-12-13 14:10:05',1,112,1),(50,1,5,'36',1,0,'Дом по улице Боголюбова, 36','dom-bogolyubova-36',NULL,'<p>Жилой массив из 9 этажей и 116 квартир, готовых к заезду, расположен вблизи транспортной развязки, спортивного клуба. Дом Боголюбова 36 утеплен для снижения энергопотерь, а в жилье проведен монтаж двухкамерных металлопластиковых стеклопакетов, новых дверей, счетчиков, котла, выполнена штукатурка стен и бетонная стяжка.</p>\r\n\r\n<p>На нижнем ярусе расположены цокольные помещения, которые могут быть арендованы в коммерческих целях под офисы или торговые точки. К преимуществам относится бесплатный паркинг, площадка для отдыха во дворе, множество магазинов, близкорасположенная линия маршрутного такси.</p>\r\n',NULL,NULL,1,3,'наземная',10,1,'','250 - 300 метров','2017-01-01 05:00:00','2016-11-09 19:28:52','2016-12-13 14:10:42',1,112,1),(51,1,5,'38',1,0,'Дом по улице Боголюбова, 38','dom-bogolyubova-38',NULL,'<p>Сдача дом Боголюбова 38 будет в 2017 году. При стройке использовался белый кирпич, монолитные блоки, исключительно качественные материалы. Установлен утеплитель по наружным стенам. Площади разной планировки и метража подготовлены к ремонту. Размер наименьшей квартиры &ndash; 44 кв. м., наибольшей &ndash; 106.</p>\r\n\r\n<p>Общее количество жилых помещений &ndash; 64, нежилых и расположенных в цоколе &ndash; 4. На верхних уровнях спроектированы двухэтажные жилища. Непосредственная близость к путям следования общественного транспорта, магазинам, спортзалу делает расположение максимально удобным. На территории комплекса функционирует парковка.</p>\r\n',NULL,NULL,1,1,'наземная',10,1,'','250 - 300 метров','2017-01-01 05:00:00','2016-11-09 19:30:27','2016-12-13 14:11:18',1,64,1),(52,1,5,'40',1,0,'Дом по улице Боголюбова, 40','dom-bogolyubova-40',NULL,'<p>Современный дом Боголюбова 40 &ndash; новое здание, вводимое в эксплуатацию в 2017 году. Оно имеет все необходимое для начала вашего собственного ремонта. Также в нем поставлены счетчики и котлы, стены утеплены пенополистиролом толщиной 12 см. 112 квартир подразделятся на одно-, двухкомнатные, а также многоуровневые апартаменты.</p>\r\n\r\n<p>Нулевой этаж доступен к сдаче в коммерческих целях под офисы и различные учреждения. Кроме этого, имеется наземный паркинг, охраняемая и убираемая территория, детская площадка, множество магазинов. До ближайшей остановки автобуса всего пару минут пешком.</p>\r\n',NULL,NULL,1,3,'наземная',10,1,'','100 - 150 метров','2017-01-01 05:00:00','2016-11-09 19:31:38','2016-12-13 14:11:56',1,112,1),(53,1,12,'1',2,0,'Дом по улице Зеленая, 1','dom-zelenaya-1',NULL,'<p>Комфортабельный дом по улице Зеленой 1 состоит из 9 жилых этажей, также есть десятый и цокольный этаж. Всего в доме 112 квартир и 8 нежилых помещений на цокольном этаже, которые возможно арендовать. Дом построен из белого кирпича, а стены его утеплены пенополестиролом слоем 12 сантиметров.</p> <p>Между этажами есть кладовки (общее количество – 11), которые можно приобрести. Кроме того, в этом доме можно не только купить, но и снять жилье – желающим предлагаются квартиры, оборудованные газовым котлом, батареями, счетчиками, металлопластиковыми окнами и входными дверями. Ближайшая остановка наземного транспорта в одной минуте ходьбы – менее чем за 500 метров. Возле дома есть паркинг.</p>',NULL,NULL,1,1,'наземная свободная парковка ',10,1,'','450 метров','2015-01-01 05:00:00','2016-11-11 15:03:35','2016-12-14 18:10:12',1,112,1),(54,0,12,'2',2,0,'Дом по улице Зеленая, 2','dom-zelenaya-2',NULL,'<p>Жилой дом на улице Зеленой 2 сдан в эксплуатацию в 2015 году. Покупателям предлагаются квартиры на любом из 9 этажей, также можно взять в аренду одно из 7 цокольных помещений (для магазина, салона красоты, кафе и так далее). Между этажами продаются кладовые помещения площадью 3.6 квадратных метров.</p> <p>Квартир с предусмотренным ремонтом нет. Также жилье можно снять – в нем уже установлен водонагревательный котел, есть батареи, счетчики, новые окна и двери. Около дома есть автомобильная парковка. Ближайшая остановка общественного транспорта располагается в 450 метрах, а идти до нее всего минуту.</p>',NULL,NULL,1,3,'наземная свободная парковка ',10,1,'','450 метров','2015-01-01 05:00:00','2016-11-11 15:07:17','2016-12-14 18:10:56',1,112,1),(55,1,13,'3',2,0,'Дом по улице Калиновая, 3','dom-kalinovaya-3',NULL,'<p>Дом по адресу Калиновая 3 находится за 450 метров до остановки общественного транспорта (3 минуты ходьбы). Он сдан в эксплуатацию в 2016 году и располагает 9 этажами со 108 квартирами. На цокольном этаже построены 8 нежилых помещений, которые можно взять в аренду. Также продается кладовка между этажами. Построен дом из прочного белого кирпича, стены надежно утеплены.</p>\r\n\r\n<p>В доме сдаются квартиры с установленными газовыми котлами, батареями, счетчиками, металлопластиковыми окнами и дверьми. Ремонта в жилых помещениях нет. Возле дома есть площадка для бесплатной парковки автомобилей.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',10,1,'','450 метров','2016-01-01 05:00:00','2016-11-11 15:08:57','2016-12-14 18:11:31',1,108,1),(56,1,13,'5',2,0,'Дом по улице Калиновая, 5','dom-kalinovaya-5',NULL,'<p>Желающим приобрести комфортное и надежное жилье предлагаются квартиры в доме по адресу Калиновая 5. Сданный в эксплуатацию в 2016 году, дом располагает 70 квартирами на 9 этажах. На цокольном этаже в аренду сдается 4 помещения. Кладовки площадью 3,6 кв. м. находятся между этажами и продаются. Рядом с домом &ndash; паркинг для автомобилей и остановка общественного транспорта (450 метров), дойти до которой можно менее чем за 3 минуты.</p>\r\n\r\n<p>Квартиры в доме не отремонтированы, однако оснащены базовым оборудованием, окнами и дверьми. В них есть газовые котлы, батареи, разводки по сантехнике и электрике. Стены дома утеплены и защищены от морозов.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',10,1,'','450 метров','2016-01-01 05:00:00','2016-11-11 15:10:17','2016-12-14 18:12:16',1,70,1),(57,1,13,'7',2,0,'Дом по улице Калиновая, 7','dom-kalinovaya-7',NULL,'<p>Утепленный дом из белого кирпича по улице Калиновой 7 станет хорошим выбором для каждой семьи. Покупателям предлагается 117 квартир на 9 этажах, также есть 10 этаж (для двухуровневых квартир) и цокольный с помещениями для аренды. Жильцам также можно купить кладовки, которые располагаются в межэтажных пространствах. Их площадь &ndash; 3,6 квадратных метров.</p>\r\n\r\n<p>Ремонта в новых квартирах нет, но в них уже предусмотрена разводка по сантехнике и электрике и все базовое оборудование. Рядом удобная транспортная развязка, до ближайшей остановки маршрутного такси &ndash; всего 3 минуты пешком. Владельцам авто предлагается бесплатный паркинг около дома.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',10,1,'','450 метров','2016-01-01 05:00:00','2016-11-11 15:11:23','2016-12-14 18:12:53',1,117,1),(58,1,14,'5',2,0,'Дом по улице Абрикосовая, 5А','dom-abrikosovaya-5a',NULL,'<p>Дом по улице Абрикосовой 5А располагает 115 квартирами на 9 этажах и 6 цокольными помещениями. Последние можно взять в аренду для магазинов, салонов красоты, кафе-баров и закусочных и других видов бизнеса. Всего в доме 26 кладовых, которые находятся между этажами и предлагаются желающим для покупки.</p>\r\n\r\n<p>Отремонтированных квартир нет, однако все они оснащены разводкой по сантехнике и электрике, базовым оборудованием (котлы, счетчики), окнами и дверьми. Стены дома утеплены пенополестиролом. До общественного транспорта можно добраться за 3 минуты. Владельцам автомобилей предлагается свободный паркинг рядом с домом.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',10,1,'','450 метров','2016-01-01 05:00:00','2016-11-11 15:14:31','2016-12-14 18:13:32',1,11,1),(59,1,14,'5',2,0,'Дом по улице Абрикосовая, 5','dom-abrikosovaya-5',NULL,'<p>Девятиэтажный жилой дом по улице Абрикосовой 5 отличается удобной транспортной развязкой &ndash; до остановки маршрутных такси всего 3 минуты ходьбы &ndash; менее 500 метров. Это новый, комфортабельный дом, построенный из белого кирпича &ndash; он был сдан в эксплуатацию в 2016 году. Стены надежно утеплены 12-сантиметровым пенополестиролом и защитят жильцов даже от суровых зим.</p>\r\n\r\n<p>Всего в доме 117 квартир на 9 этажей, предусмотрен также 10-ый этаж и цоколь. В полуподвале располагаются 7 помещений, пригодных для аренды. Между этажами есть 18 кладовок &ndash; их можно купить при необходимости. Рядом с домом находится наземная парковка.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',10,1,'','450 метров','2016-01-01 05:00:00','2016-11-11 15:15:31','2016-12-14 18:14:10',1,117,1),(60,1,14,'7',2,0,'Дом по улице Абрикосовая, 7','dom-abrikosovaya-7',NULL,'<p>Многоквартирный девятиэтажный дом по адресу Абрикосовая 7 открыл двери для жильцов в 2016 году. Вниманию покупателей предлагается 71 квартира. Также можно взять в аренду одно из цокольных помещений или же купить кладовку площадью 3,6 квадратных метра. Дом построен из высококачественного белого кирпича, утеплен пенополестиролом и с монолитными межэтажными перекрытиями.</p>\r\n\r\n<p>В квартирах нет ремонта, но предусмотрены разводки для сантехнического и электрического оборудования, окна, двери и другая базовая техника. До транспортной остановки &ndash; 450 метров, которые можно пешком пройти за 3 минуты. Рядом с домом построена бесплатная парковка.</p>\r\n',NULL,NULL,1,3,'наземная свободная парковка ',10,1,'','450 метров','2016-01-01 05:00:00','2016-11-11 15:16:41','2016-12-14 18:14:45',1,71,1);
